import React, { useContext } from "react";
import { Link } from "react-router-dom";
import { Logo } from "./Logo";
import { LoginButton, RegisterButton } from "../UI/Buttons";
import { QuizzesContext } from "../../contexts/quizzes/Quizzes";
import { NavbarContainer, MenuItemsContainer } from "./NavbarComponents";
import { NavbarLinks } from "./NavbarLinks";

export const AuthButtons: React.FC = () => {
  return (
    <MenuItemsContainer flex={1}>
      <Link to="/login">
        <LoginButton>Login</LoginButton>
      </Link>
      <Link to="/register">
        <RegisterButton>Register</RegisterButton>
      </Link>
    </MenuItemsContainer>
  );
};

export const Navbar: React.FC = () => {
  const { reset } = useContext(QuizzesContext);

  return (
    <NavbarContainer>
      <Link to="">
        <Logo reset={reset} />
      </Link>
      <NavbarLinks />
    </NavbarContainer>
  );
};
